export default function NewVisits() {
  const token = localStorage.getItem("token");
  if (!token) {
    window.location.href = "/login";
  }

  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [employees, setEmployees] = useState([]);
  const [reasons, setReasons] = useState([]);
  const [newVisit, setNewVisit] = useState({
    firstname: "",
    lastname: "",
    company: "",
    entranceDate: "2023-04-26T13:10:09.151Z",
    encouteredPerson: "",
    reason: "",
  });

  useEffect(() => {
    const token = localStorage.getItem("token");
    const config = {
      headers: { Authorization: `Bearer ${token}` },
    };
    axios.get("http://127.0.0.1:8000/api/employees", config).then(
      (response) => {
        setIsLoaded(true);
        const employees = response.data["hydra:member"];
        console.log(employees);
        setEmployees(employees);
      },
      (error) => {
        setIsLoaded(true);
        setError(error);
      }
    );
    axios.get("http://127.0.0.1:8000/api/reasons", config).then(
      (response) => {
        setIsLoaded(true);
        const reasons = response.data["hydra:member"];
        console.log(reasons);
        setReasons(reasons);
      },
      (error) => {
        setIsLoaded(true);
        setError(error);
      }
    );
  }, []);

  if (error) {
    return (
      <>
        <Navbar current="visits" />
        <div className="m-10">
          <div>Error: {error.message}</div>
        </div>
      </>
    );
  } else if (!isLoaded) {
    return (
      <>
        <Navbar current="visits" />
        <div className="m-10">
          <div>Loading...</div>
        </div>
      </>
    );
  } else {
    return (
    <>
      <Navbar current="newvisit" />
      <form className="max-w-6xl mx-auto px-6 py-12">
        <div className="bg-w<hite shadow rounded-lg p-10">
          <h1 className="text-3xl font-bold pb-6">
            Saisie d'une nouvelle visite
          </h1>

          <div className="grid grid-cols-1 gap-10 sm:grid-cols-2">
            <div>
              <label
                htmlFor="first-name"
                className="block text-sm font-medium leading-5 text-gray-700"
              >
                Prénom
              </label>
              <div className="mt-1 relative rounded-md shadow-sm">
                <input
                  type="text"
                  name="firstname"
                  id="firstname"
                  autoComplete="given-name"
                  className="block w-full pr-10 form-input sm:text-sm sm:leading-5"
                  placeholder="Entrez le prénom"
                />
              </div>
            </div>

            <div>
              <label
                htmlFor="last-name"
                className="block text-sm font-medium leading-5 text-gray-700"
              >
                Nom
              </label>
              <div className="mt-1 relative rounded-md shadow-sm">
                <input
                  type="text"
                  name="last-name"
                  id="last-name"
                  autoComplete="family-name"
                  className="block w-full pr-10 form-input sm:text-sm sm:leading-5"
                  placeholder="Entrez le nom"
                />
              </div>
            </div>

            <div>
              <label
                htmlFor="person-encountered"
                className="block text-sm font-medium leading-5 text-gray-700"
              >
                Personne rencontrée
              </label>
              <div className="mt-1 relative rounded-md shadow-sm">
                <select
                  id="person-encountered"
                  name="person-encountered"
                  autoComplete="off"
                  className="block w-full form-select sm:text-sm sm:leading-5"
                >
                  <option>Homer Simpson</option>
                  <option>Mr Burns</option>
                  <option>Bart Simpson</option>
                </select>
              </div>
            </div>

            <div>
              <label
                htmlFor="visit-purpose"
                className="block text-sm font-medium leading-5 text-gray-700"
              >
                Motif de la visite
              </label>
              <div className="mt-1 relative rounded-md shadow-sm">
                <select
                  id="visit-purpose"
                  name="visit-purpose"
                  autoComplete="off"
                  className="block w-full form-select sm:text-sm sm:leading-5"
                >
                  <option>Suivi d'alternant</option>
                  <option>Travaux</option>
                  <option>Entretien</option>
                </select>
              </div>
            </div>
          </div>

          <div className="mt-8 border-t border-gray-200 pt-8">
            <div className="flex justify-end">
              <a href="/visits">
              <button
              type="button"
              className="px-4 py-2 mr-2 font-medium tracking-wide text-white capitalize transition-colors duration-200 transform bg-blue-600 rounded-md hover:bg-blue-500 focus:outline-none focus:bg-blue-500"
            >
              Annuler
            </button>
          </a>
          <button
            type="submit"
            className="px-4 py-2 font-medium tracking-wide text-white capitalize transition-colors duration-200 transform bg-green-600 rounded-md hover:bg-green-500 focus:outline-none focus:bg-green-500"
          >
            Enregistrer
          </button>
        </div>
      </div>
    </div>
  </form>
</>
);
}
}
